import schema from "./schema";
import uiSchema from "./uiSchema";
import formData from "./formData"
import PreviewTemplate from "@frontend-components/admin/lib/components/AppKp/preview/Page"

export default {
    id: 1,
    schemaType: 'kp',
    name: 'page/grid',
    schema: schema,
    uiSchema: uiSchema,
    formData: formData,
    preview: {
        template: PreviewTemplate
    }
}
